    function logDearData(params) {
        var paramsLocal = params;
        var ret = paramsLocal;
        if (paramsLocal instanceof Array) {
            ret = []
        } else if (paramsLocal instanceof Object) {
            ret = {}
        }
        for (var i in paramsLocal) {
            ret["" + i] = paramsLocal[i];
            if (paramsLocal[i] instanceof Array || paramsLocal[i] instanceof Object) {
                ret["" + i] = logDearData(paramsLocal[i])
            }
        }
        return ret;
    }
    function _log() {
        var ret = null;
        var param = "";
        for(var i in arguments){
            if(i==0){
                param = logDearData(arguments[i]);
            }else if(i==1){
                ret = logDearData(arguments[i]);
            }else{
                alert('');
                return;
            }
        }
        if(arguments.length == 1){
            console.log(param);
        }else if(arguments.length == 2){
            console.log(param, ret);
        }
    }
    c._log = _log
